import { Button, VStack, Center } from "@chakra-ui/react";
import React from "react";
import { Link } from "react-router-dom";

const HomePage = () => {
  return (
    <Center height="100vh">
      <VStack spacing={4}>
        <Button 
          size="lg" 
          color="white" 
          borderRadius="full" 
          bgColor="blue.500" 
          _hover={{ bg: "blue.600" }}
        >
          <Link to="/">Home</Link>
        </Button>
        <Button 
          size="lg" 
          color="white" 
          borderRadius="full" 
          bgColor="green.500" 
          _hover={{ bg: "green.600" }}
        >
          <Link to="/exchanges">Exchanges</Link>
        </Button>
        <Button 
          size="lg" 
          color="white" 
          borderRadius="full" 
          bgColor="red.500" 
          _hover={{ bg: "red.600" }}
        >
          <Link to="/coins">Coins</Link>
        </Button>
      </VStack>
    </Center>
  );
};

export default HomePage;
